  }
  const dec=()=>{
    const newm=num-1;
    if(newm>=0)
    setNum(newm);
  }

  return(
    <>
    <div className="main">
      <div className="box">
        <h1>{num}</h1>
        <div className="btn">
          <button onClick={inc}>Increment</button>
          <button onClick={dec}>Decrement</button>
        </div>
      </div>
    </div>
    </>
  );
}

export default App;
